// componente que cria botao de excluir todos filtros e retornar o que era antes

import { useContext } from 'react';
import { contextApp } from '../context/ContextApp';

export default function Filters() {
  const { filters } = useContext(contextApp);
  return (
    <div>
      {filters.map((f) => (
        <div key={ f }>
          <div>{ f }</div>
          <button>Exclude</button>
        </div>
      ))}
    </div>
  );
}
